import React, { Component } from 'react';
import Button from '@mui/material/Button';

function Login() {
    return (
        <>
            <TextField
                id="outlined-name"
                label="Name"
                //value={name}
                onChange={handleChange}
            />
            <TextField
                id="outlined-uncontrolled"
                label="Uncontrolled"
                defaultValue="foo"
            />
            <Button variant="contained">Login</Button>
        </>
    );
}

export default Login
